// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import {AccessControlDefaultAdminRulesUpgradeable} from "@openzeppelin/contracts-upgradeable/access/extensions/AccessControlDefaultAdminRulesUpgradeable.sol";
import {ERC20PermitUpgradeable} from "@openzeppelin/contracts-upgradeable/token/ERC20/extensions/ERC20PermitUpgradeable.sol";
import {Initializable} from "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";

import {ISimpleToken} from "./interfaces/ISimpleToken.sol";

contract SimpleToken is ISimpleToken, Initializable, ERC20PermitUpgradeable, AccessControlDefaultAdminRulesUpgradeable {
  bytes32 public constant SERVICE_ROLE = keccak256("SERVICE_ROLE");

  mapping(bytes32 => bool) private mintIds;
  mapping(bytes32 => bool) private burnIds;

  modifier idempotentMint(bytes32 _idempotencyKey) {
    if (mintIds[_idempotencyKey]) {
      revert IdempotencyKeyAlreadyExist(_idempotencyKey);
    }
    _;
    mintIds[_idempotencyKey] = true;
  }

  modifier idempotentBurn(bytes32 _idempotencyKey) {
    if (burnIds[_idempotencyKey]) {
      revert IdempotencyKeyAlreadyExist(_idempotencyKey);
    }
    _;
    burnIds[_idempotencyKey] = true;
  }

  /// @custom:oz-upgrades-unsafe-allow constructor
  constructor() {
    _disableInitializers();
  }

  function initialize(string memory _name, string memory _symbol) public initializer {
    __ERC20_init(_name, _symbol);
    __ERC20Permit_init(_name);
    __AccessControlDefaultAdminRules_init(1 days, msg.sender);
  }

  function mint(address _account, uint256 _amount) external onlyRole(SERVICE_ROLE) {
    _mint(_account, _amount);
  }

  function mint(
    bytes32 _idempotencyKey,
    address _account,
    uint256 _amount
  ) external onlyRole(SERVICE_ROLE) idempotentMint(_idempotencyKey) {
    _mint(_account, _amount);
  }

  function burn(address _account, uint256 _amount) external onlyRole(SERVICE_ROLE) {
    _burn(_account, _amount);
  }

  function burn(
    bytes32 _idempotencyKey,
    address _account,
    uint256 _amount
  ) external onlyRole(SERVICE_ROLE) idempotentBurn(_idempotencyKey) {
    _burn(_account, _amount);
  }
}

